import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <nav nameClass="navbar bg-light">
        <div nameClass="container">
          <img src="/docs/5.2/assets/brand/bootstrap-logo.svg" alt="Bootstrap" />
        </div>
      </nav>
    </div>
  );
}

export default App;
